## Tooltip

A tooltip is a small box that appears when you hover over an element. It is used to provide additional information about the element.

## React Context

React Context is a way to pass data from a parent component to a child component without having to pass the data through every level of the component tree. It is useful for passing data that is needed by many components, such as theme data or user data.

## Creating a Tooltip

To create a Tooltip in NextJS using React Context, we will first create a TooltipContext. This context will hold the state of the Tooltip, such as whether it is open or closed, and the content of the Tooltip.

We will then create a Tooltip component that uses the TooltipContext to display the Tooltip. The Tooltip component will take in a children prop, which is the element that the Tooltip will be attached to.

The Tooltip component will also take in a trigger prop, which is the event that will open the Tooltip. The trigger prop can be a string, such as 'hover', or a function that returns a boolean.

The Tooltip component will use the useContext hook to access the TooltipContext and update the state of the Tooltip.

The Tooltip component will also use the useEffect hook to close the previously opened Tooltip when a new Tooltip is opened.

Here is an example of how to create a Tooltip in NextJS using React Context:

```
import React, { createContext, useContext, useEffect, useRef, useState } from 'react';

const TooltipContext = createContext();

export const useTooltipContext = () => useContext(TooltipContext);

export const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const tooltipRef = useRef();

  useEffect(() => {
    const handleClick = (event) => {
      if (tooltipRef.current && !tooltipRef.current.contains(event.target)) {
        setTooltip(null);
      }
    };

    document.addEventListener('click', handleClick);

    return () => {
      document.removeEventListener('click', handleClick);
    };
  }, []);

  const openTooltip = (content, { target }) => {
    setTooltip({ content, target });
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip }}>
      {children}
      {tooltip && (
        <div
          ref={tooltipRef}
          className="fixed z-10"
          style={{
            top: tooltip.target.offsetTop + tooltip.target.offsetHeight + 10,
            left: tooltip.target.offsetLeft,
          }}
        >
          <div className="p-2 bg-white border border-gray-300 rounded shadow-sm">
            {tooltip.content}
          </div>
        </div>
      )}
    </TooltipContext.Provider>
  );
};

export const Tooltip = ({ children, trigger = 'hover', className }) => {
  const { openTooltip, closeTooltip } = useTooltipContext();

  const handleMouseEnter = () => {
    if (trigger === 'hover') {
      openTooltip(children, { target: event.currentTarget });
    }
  };

  const handleMouseLeave = () => {
    if (trigger === 'hover') {
      closeTooltip();
    }
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
      className={className}
    >
      {children}
    </div>
  );
};
```

In this example, we have created a TooltipProvider component that provides the TooltipContext. The TooltipProvider component also manages the state of the Tooltip and closes the previously opened Tooltip when a new Tooltip is opened.

